const mongoose = require('mongoose');
const bcrypt = require('bcrypt');

const userSchema = new mongoose.Schema({
    firstName: { type: String, required: true },
    lastName: { type: String, required: true },
    email: {
        type: String,
        required: true,
        unique: true,
        match: [/.+\@.+\..+/, 'Please fill a valid email address']
    },
    phoneNumber: {
        type: String,
        required: true,
        validate: {
            validator: v => /\d{10}/.test(v),
            message: props => `${props.value} is not a valid phone number!`
        }
    },
    username: { type: String, required: true, unique: true },
    password: { type: String, required: true },
    posts: { type: [mongoose.Schema.Types.ObjectId], ref: 'Post', required: false, default: [] },
    followers: { type: [mongoose.Schema.Types.ObjectId], ref: 'User', required: false, default: [] },
    following: { type: [mongoose.Schema.Types.ObjectId], ref: 'User', required: false, default: [] },
    profilePic: {
        type: String,
        required: false,
        default: ''
    },
    bio: { type: String, required: false },
    tags: { type: [String], default: [], required: false }
}, { timestamps: true });

userSchema.statics.validateUser = async (req) => {

    const errorMsgs = []

    if (!req.username) { errorMsgs.push("User name is required") }
    if (!req.firstName) { errorMsgs.push("First name is required") }
    if (req.firstName.length < 1) { errorMsgs.push('User name cannot be empty') }
    if (req.lastName.length < 1) { errorMsgs.push('Last name cannot be empty') }
    if (!req.email) { errorMsgs.push("Email is required") }
    if (!/^[^@]+@[^@]+$/.test(req.email)) { errorMsgs.push("Email must follow the pattern: Example@Facegram.com") }
    if (!req.phoneNumber) { errorMsgs.push("Phone number is required") }
    if (req.password && req.password.length < 8) { errorMsgs.push("Password must contain 8 digits or more") }
    if (req.phoneNumber.length != 10) { errorMsgs.push("Phone number must contain 10 digits") }
    if (!/^\d+$/.test(req.phoneNumber)) { errorMsgs.push("Phone number must contain only digits") }
    let foundUser = await DBusers.findOne({ username: req.username });
    if (foundUser && foundUser._id != req._id) {
        errorMsgs.push("User name already in use")
    }
    foundUser = await DBusers.findOne({ email: req.email });
    if (foundUser && foundUser.email != req.email) {
        errorMsgs.push("Email already in use")
    }

    return errorMsgs;

}

userSchema.statics.addNewUser = async (req) => {
    if (DBusers.validateUser(req).length > 0) {
        return 'User request is not valid'
    }

    // Remove the id that comes from the frontend
    delete req._id;

    const reqPassword = req.password;
    const hashedPassword = await bcrypt.hash(reqPassword, 12);
    const user = new DBusers({
        ...req,
        password: hashedPassword
    })
    await user.save();
    return user._id;
}

userSchema.methods.addPost = async function (postID) {
    if (!this.posts) {
        this.posts = []; // Initialize posts array if undefined
    }
    this.posts.push(postID); // Push the new post ID into the posts array
    await this.save(); // Save the user document with the updated posts array
};


userSchema.methods.update = async function (newUserVersion) {

    let changedSaved = false;

    // Validate the new version
    if (DBusers.validateUser(newUserVersion).length > 0) {
        return changedSaved;
    } else {
        try {
            // Check if version mismatch exists and refetch user if needed
            const currentUser = await DBusers.findById(this._id);
            if (currentUser.__v !== this.__v) {
                // Reload the document to avoid version conflict
                return changedSaved;
            }

            // Update fields only if the new version has them and the value is different
            if (newUserVersion.firstName !== undefined && this.firstName !== newUserVersion.firstName) {
                this.firstName = newUserVersion.firstName;
            }
            if (newUserVersion.lastName !== undefined && this.lastName !== newUserVersion.lastName) {
                this.lastName = newUserVersion.lastName;
            }
            if (newUserVersion.email !== undefined && this.email !== newUserVersion.email) {
                this.email = newUserVersion.email;
            }
            if (newUserVersion.phoneNumber !== undefined && this.phoneNumber !== newUserVersion.phoneNumber) {
                this.phoneNumber = newUserVersion.phoneNumber;
            }
            if (newUserVersion.username !== undefined && this.username !== newUserVersion.username) {
                this.username = newUserVersion.username;
            }
            if (newUserVersion.posts !== undefined && JSON.stringify(this.posts) !== JSON.stringify(newUserVersion.posts)) {
                this.posts = newUserVersion.posts;
            }
            if (newUserVersion.followers !== undefined && JSON.stringify(this.followers) !== JSON.stringify(newUserVersion.followers)) {
                this.followers = newUserVersion.followers;
            }
            if (newUserVersion.following !== undefined && JSON.stringify(this.following) !== JSON.stringify(newUserVersion.following)) {
                this.following = newUserVersion.following;
            }
            if (newUserVersion.profilePic !== undefined && this.profilePic !== newUserVersion.profilePic) {
                this.profilePic = newUserVersion.profilePic;
            }
            if (newUserVersion.bio !== undefined && this.bio !== newUserVersion.bio) {
                this.bio = newUserVersion.bio;
            }
            if (newUserVersion.tags !== undefined && JSON.stringify(this.tags) !== JSON.stringify(newUserVersion.tags)) {
                this.tags = newUserVersion.tags;
            }
            if (newUserVersion.password !== undefined) {
                const trimmedPassword = newUserVersion.password.trim(); // Trim whitespace
                const isSamePassword = await bcrypt.compare(trimmedPassword, this.password);
                if (!isSamePassword) {
                    console.log('Changing password to:', trimmedPassword); // Debugging line
                    this.password = await bcrypt.hash(trimmedPassword, 12);
                }
            }

            changedSaved = true;
        } catch (e) {
            console.log(e);
        }
    }

    await this.save();
    return changedSaved;
};


const DBusers = mongoose.model('User', userSchema);


